	DeprecatedFvRsNodeAttSet, _ := types.SetValueFrom(ctx, deprecatedFvRsNodeAttType, legacyAttributeValues)
	planData.DeprecatedFvRsNodeAtt = DeprecatedFvRsNodeAttSet
